import React, { useEffect } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import { useSelector, useDispatch } from "react-redux";
import { getGradedQuiz } from "../../features/gradeSlice";

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

export default function EnrolledStudentsTable(props) {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Student Name</TableCell>
            <TableCell align="right">Grade</TableCell>
            <TableCell align="right">Total Items</TableCell>
            <TableCell align="right">Score</TableCell>
            <TableCell align="right">Quiz Name(g)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {props.students.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.full_name}
              </TableCell>
              <TableCell align="right">{row.email}</TableCell>
              <TableCell align="right">{row.username}</TableCell>
              <TableCell align="right">
                <Avatar src={row.avatar} />
              </TableCell>
              <TableCell align="right">{row.last_login}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
